import React, {useState } from 'react';
import moment from 'moment';

const SelectDate = ({
    incomingdate,
    typeOne,
    onHandleChangeEvent,
    disable
}) => {
    console.log("disable",disable);
    const [date, setDate] = useState();
    const resultDate=moment(incomingdate).format('YYYY-MM-DD');
    return(
        <div>
            {
                disable ?
                    <input 
                        value={resultDate}
                        type="date" 
                        name={typeOne} 
                        onChange={(e)=>{
                            setDate(e.target.value); 
                            onHandleChangeEvent(e)
                        }}
                        disabled
                    />
                    :
                    <input 
                        value={resultDate}
                        type="date" 
                        name={typeOne} 
                        onChange={(e)=>{
                            setDate(e.target.value); 
                            onHandleChangeEvent(e)
                        }}
                    />
            }

        </div>
    );
}
export default SelectDate;
